import Phaser from 'phaser';
import { screenText, startText, startTextInter } from './TitleScreenText';

class TitleScene extends Phaser.Scene{

    create(){
        screenText(this);
        startText(this);
    }

    update(){
        startTextInter(this)
    }
}

export default TitleScene
